import axios from "axios";

export const useDeleteResult = () => {
    return async (resultId) => {
        try {
            //only send the delete request if resultId is not empty
            if (!resultId){
                console.log('result id is not provided');
                return;
            }
            const url = `http://localhost:5000/api/result/${resultId}`;
            const response = await axios.delete(url);
            console.log('Result deleted successfully:', response.data);
        } catch (error) {
            console.error('Error deleting result:', error);
            if (error.response) {
                console.log('Error status:', error.response.status);
                console.log('Error message:', error.response.data.message);
            }
        }
    };
};
